import './app.css';

function App() {
  const name = 'hanna';
  return (
    <>
      <h1>Hello!</h1>
      {name && <h1> Hello! {name} :) </h1>} // name이 있다면 출력
      {['🐯', '💙'].map((item) => (
        <h1>{item}</h1>
      ))}
    </>
  );
}

export default App;
